import './App.css';
import { Route, Router } from "react-router-dom";
import UserInfo from "./Components/UserInfo"
import Sample from "./Components/Sample"

function App() {
  return (
    <div className="App">
      <Router> 
        <Route path='/' component={UserInfo} /> 
        <Route path='/Sample' component={Sample} /> 
      </Router>
    </div>
  );
}

export default App;
